import React, { useState, useEffect } from 'react';
import { Navigate } from 'react-router-dom';
import '../../index.css';
import Navbar from '../Layouts/standart';

function Blog() {
    return (
        <div>
            <Navbar></Navbar>
            <div>
                <h1>Ini halaman Blog</h1>
                <h3 className='mt-5'>Inputkan gambar</h3>
                <div className="mb-3">
                    <label htmlFor="exampleInputEmail1" className="form-label">Gambar</label>
                    <input type="file" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                </div>

            </div>
        </div>
    );
}

export default Blog
